import React from 'react';
import { Line }from 'react-chart.js';
var data=[];
class GraphComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            data: {
                labels:["1", "2","3,","4"],
                dataSets:[
                    {
                        label:"blue",
                        backgroundColor: "rgba(255, 0, 255, 0.75)",
                        data:[4, 5, 10, 12]
                    },
                    {
                        label:"green",
                        backgroundColor: "rgba( 0, 255, 0, 0.75)",
                        data:[14, 55, 10, 42]
                    }

                ]
            }
        }
    }
    render() {
        return(

            <div style={{
                positon: "relative",
                width:"300px",
                height:"300px"
            }}>
                <line
                    options={{
                        responsive:true
                    }}
                    data={this.state.data}
                />
            </div>

        );
    }
}
export { GraphComponent };
